import React, { createElement, useState } from 'react'
import ReactDOM from 'react-dom'
import { SafeAreaView, StyleSheet, Text, View } from 'react-native'
import database from '@react-native-firebase/database';
import * as firebase from "firebase";
import { firebaseConfig } from "./Firebase";
import Order from "./Order";
import { render } from 'react-dom';

firebase.initializeApp(firebaseConfig);

const App = () => {

  const ret = () => {
    var container = [];
    for (var i = 0; i < 10; i++) {
      container[i] = <div className={'o' + i}>{i}</div>;
    }
    return container
  }

  const dtb = () => {
    const [col, setCol] = useState('p')
    firebase.database()
      .ref('orders')
      .on('value', gotData, errData)
  }

  function gotData(data) {
    var orders = data.val();
    var keys = Object.keys(orders);
    // var li = [];
    console.log(keys);
    for (var i = 0; i < keys.length; i++) {
      var k = keys[i];
      var firstName = orders[k].firstName;
      var items = orders[k].items;
      var lastName = orders[k].lastName;
      var email = orders[k].email;
      var city = orders[k].city;
      var phone = orders[k].phone;
      var zipCode = orders[k].zipCode;
      var address = orders[k].address;
      var li = <Order items={items} firstName={firstName} lastName={lastName} email={email} city={city} phone={phone} zipCode={zipCode} address={address} />;
      console.log(li);
      ReactDOM.render(
        li,
        document.querySelector("#o")
      );
    }

  }

  function errData(err) {
    console.log('Error!');
    console.log(err);
  }



  return (
    <SafeAreaView>
      <View nativeID='o'>
        <Text>{ret()}</Text>{dtb()}
      </View>
    </SafeAreaView>
  )
}

export default App

